- input: "TEXT\x1CC00016386\x1C.TEXT\x1C\x1CF3XN\x1CJames - American Bakers PAC recognizes
    that we excessively contributed to the Richard Burr Committee for the 2010 General
    by $1,000.  We are in close contact with the Burr campaign, specifically Ms. Mary
    Comer, and have started the proceedings to obtain a refund from them for the $1,000
    excessive contribution.  Because we have no federal disbursement activity from
    Oct. 1 - Oct 13, we will not be filing a pre-general report.  However, we will
    be filing a post general report and will hope to have this excessive contribution
    to the Burr campaign resolved by that filing deadline.  Thank you for your guidance,
    Kelly Knowles\n"
